CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_books_cud` (IN `idBuku` INT, IN `namaBuku` TEXT, IN `namaPengarang` TEXT, IN `namaPenerbit` TEXT, IN `tahunTerbit` INT(4), IN `idKlasifikasi` VARCHAR(25), IN `flagPinjam` BOOLEAN, IN `idKategori` INT, IN `idISBN` VARCHAR(13), IN `unitPrice` DECIMAL(18,2), IN `serialNumber` VARCHAR(255), IN `idJilid` INT, IN `currentUser` VARCHAR(255), IN `flag` BOOLEAN)  BEGIN
    DECLARE hasil int;
    DECLARE historyDesc text;
    DECLARE hisCode char(5);
    DECLARE newID int;
    SET hisCode = 'BOOKS';
    SET newID = (SELECT CONCAT(YEAR(NOW()), RIGHT(MAX(ID_Buku)+1,4)) from buku);
    IF flag IS NULL THEN
            ID_Buku,
            NamaBuku,
            NamaPengarang,
            NamaPenerbit,
            TahunTerbit,
            ID_Klasifikasi,
            FlagPinjam,
            ID_Kategori,
            ID_ISBN,
            UnitPrice,
            SerialNumber,
            ID_Jilid,
            FlagActive
        ) 
        VALUES(
            newID,
            namaBuku,
            namaPengarang,
            namaPenerbit,
            tahunTerbit,
            idKlasifikasi,
            flagPinjam,
            idKategori,
            idISBN,
            unitPrice,
            serialNumber,
            idJilid,
            1
        );
        SET hasil = 1;
        SET historyDesc = CONCAT(namaBuku, ' created by ', currentUser);
        SET idBuku = newID;
    ELSE IF flag = 1 THEN
        UPDATE buku 
        SET 
            NamaBuku = namaBuku,
            NamaPengarang = namaPengarang,
            NamaPenerbit = namaPenerbit,
            TahunTerbit = tahunTerbit,
            ID_Klasifikasi = idKlasifikasi,
            FlagPinjam = flagPinjam,
            ID_Kategori = idKategori,
            ID_ISBN = idISBN,
            UnitPrice = unitPrice,
            SerialNumber = serialNumber,
            ID_Jilid = idJilid
        WHERE
            FlagActive = 1 AND 
            ID_Buku = idBuku;
        SET hasil = 1;
        SET historyDesc = CONCAT(namaBuku, ' updated by ', currentUser);
    ELSE IF flag = 0 THEN
        UPDATE buku 
        SET 
            FlagActive = 0 
        WHERE 
            ID_Buku = idBuku;
        SET hasil = 1;
        SET historyDesc = CONCAT(namaBuku, ' deleted by ', currentUser);
    END IF;
    END IF;
    END IF;
    CALL sp_history_insert(idBuku, hisCode,historyDesc, currentUser);
    SELECT hasil AS Result;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_book_detail` (IN `idBuku` INT)  BEGIN
