CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login_cud` (IN `idLogin` INT, IN `userName` TEXT, IN `fullName` TEXT, IN `pass` TEXT, IN `flag` BOOLEAN, IN `currentUser` VARCHAR(255))  BEGIN
    DECLARE hasil int;
    DECLARE historyDesc text;
    DECLARE hisCode char(5);
    SET hisCode = 'LOGIN';
    IF idLogin IS NULL THEN
            Username,
            FullName,
            Password
        ) VALUES(
            userName,
            fullName,
            pass
        );
        SET hasil = 1;
        SET historyDesc = CONCAT(FullName, ' added by ', currentUser);
        SET idLogin = LAST_INSERT_ID();
    ELSE IF flag = 1 THEN
        UPDATE
            login
        SET
            Username = userName,
            FullName = fullName,
            Password = pass
        WHERE
            FlagActive = 1 AND
            ID_Login = idLogin;
        SET hasil = 1;
        SET historyDesc = CONCAT(FullName, ' updated by ', currentUser);
    ELSE IF flag = 0 THEN
        UPDATE
            login
        SET
            FlagActive = 0
        WHERE
            ID_Login = idLogin;
        SET hasil = 1;
        SET historyDesc = CONCAT(FullName, ' deleted by ', currentUser);
    END IF;
    END IF;
    END IF;
    CALL sp_history_insert(idLogin, hisCode,historyDesc, currentUser);
    SELECT hasil AS Result;
END$$

