CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_peminjaman` (IN `idPeminjaman` INT, IN `idBuku` INT, IN `idMember` INT, IN `TanggalPinjam` DATE, IN `TanggalKembali` DATE, IN `flagKembali` BIT(1), IN `currentUser` VARCHAR(255))  BEGIN
    DECLARE hasil int;
    DECLARE historyDesc text;
    DECLARE hisCode char(5);
    DECLARE bookName text;
    DECLARE memberName text;
    SET hisCode = 'PNJAM';
    IF idPeminjaman IS NULL THEN
            ID_Buku,
            ID_Member,
            TanggalPinjam,
            TanggalKembali,
            FlagSudahKembali
        )
        VALUES(
            idBuku,
            idMember,
            TanggalPinjam,
            TanggalKembali,
            0
        );
        SET idPeminjaman = LAST_INSERT_ID();
        SELECT NamaBuku into bookName from buku where FlagActive = 1 AND ID_Buku = idBuku;
        SELECT NamaMember into memberName from member where FlagActive = 1 AND ID_Member = idMember;
        UPDATE buku SET FlagPinjam = 1 WHERE ID_Buku = idBuku;
        SET hasil = 1;
        SET historyDesc = CONCAT(memberName, ' borrowed a book called ', bookName);
        CALL sp_history_insert(idPeminjaman, hisCode,historyDesc, currentUser);
        SELECT hasil AS Result;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_peminjaman_select_all` ()  BEGIN
    SELECT 
        aa.ID_Peminjaman, aa.ID_Buku, aa.NamaBuku, aa.ID_Member , bb.NamaMember, aa.TanggalPinjam, aa.TanggalKembali, aa.FlagSudahKembali 
    FROM (
        SELECT 
            a.ID_Peminjaman, a.ID_Buku, b.NamaBuku, a.ID_Member, a.TanggalPinjam, a.TanggalKembali, a.FlagSudahKembali 
        FROM peminjaman a INNER JOIN buku b 
        ON  a.ID_Buku = b.ID_Buku
    ) aa INNER JOIN member bb 
    ON aa.ID_Member = bb.ID_Member
    ORDER BY aa.TanggalPinjam DESC;
END$$

